import React, { useState } from 'react';

const App = () => {

    let [cname, setName] = useState("");
    const inputEvent = (event) => {

        console.log(event.target.value);
        setName(event.target.value);
    }
    return (
        <>
            <div>
                <h1> Hello {cname}</h1>
                <input 
                    type='text' 
                    placeholder="Enter Your Name"
                    onChange={inputEvent} 
                    value=""
                />
                <button>CLick Me</button>
            </div>
        </>
    );
}

export default App;
